import './index.css';

function MainPage() {
	return (
		<div>
			<div id="header">
				<div id="header-area">
				<img src="images/mainLogo.png" width="100" height="100"></img>
					<h3>한성마켓</h3>
				</div>
			</div>
			<div id="body">
				<div id="banner">
					<img src="images/bannerImg.png" />
				</div>
			</div>
		</div>
	);
}

export default MainPage;
